I’ve been lapping up Australian fiction this year, and this one is a stand out. A bold, raw and honest look at the interpersonal politics of sex and power, race and loneliness, from a strong female voice to watch. 

Written from the perspective of a former child prodigy Jena Lin, who churned through the machine of fame and professional notoriety at a young age, coming out the other side burned out and using meaningless sex to fill the void of her own identity. 

Jena is entirely relatable on many levels, and any woman who has ever been single for even a heartbeat as an adult, will recognise her aching loneliness as she grapples with confoundingly complex relationships with her men, her friends, her family and her own sense of self.

As if that wasn’t enough, the depth of her explorations also extend to the unpicking of many a musical masterpiece, note by note, phrase by phrase. 

This book is a deeply quenching drink I didn’t realise I needed.

